import { article,brand,cta,feature,navbar} from "./components";
import {footer,whatGPT3,possibility,header,features,blog} from "./container";
import './App.css';
import './index.css';

const App = () => {
  return (
    <div className="App">
        <div className='gradient__bg'>
        <navbar />
        <header>Header</header>
        </div>
        <brand >brand</brand>
        <whatGPT3>whatGPT3</whatGPT3>
        <features>feautures</features>
       <possibility>possibility</possibility>
        <cta>Cta</cta>
        <blog>Blog</blog>
        <footer>footer</footer>
    </div>
  )
}

export default App;
